const nameRegex = /^[A-Za-z\s]+$/;
const idNumberRegex = /^[0-9]{13}$/;
const accountRegex = /^[0-9]{6,20}$/;
const passwordRegex = /^(?=.*[A-Z])(?=.*[a-z])(?=.*[0-9])(?=.*[!@#$%^&*]).{8,}$/;
